import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import {createStore} from 'redux';
import { Provider } from 'react-redux';

const defaultState={
  like:0
}

const reducer =(state=defaultState,action) =>{
  switch(action.type){

    case 'addLike':
      return {...state, like:state.like+action.like}

    case 'removeLike':
      return {...state, like:state.like+action.like}

    default:
      return state
  }
}

const store =createStore(reducer)

ReactDOM.render(
  <React.StrictMode>
    <Provider>
    <App />
    </Provider>
  </React.StrictMode>,
  document.getElementById('root')
);
